import { Button, Container, Grid, Icon, LinearProgress, TextField,Paper } from '@mui/material';
import React,{useState,useMemo,useEffect} from 'react';
import {Link as Rlink,useHistory,useParams} from 'react-router-dom';
import { ValidatorForm,TextValidator } from 'react-material-ui-form-validator';
import AlertMessage,{ALERT_TYPE} from '../components/AlertMessage';
import auth from '../services/auth';

import {useSelector,useDispatch} from 'react-redux';
import {login,appTheme} from '../store/actions';

const Login:React.FC = ()=>{
    const dispatch = useDispatch();
    const history = useHistory();
    const qParams = useParams();

    const isLogin = useSelector((state:any)=>state.isLogin);
    const Role = useSelector((state:any)=>state.user?state.user.role:'');
    const [Message,setMessage] = useState('');
    const [processing,setProcessing] = useState(false);
    const [Email,setEmail] = useState('');
    const [Password,setPassword] = useState('');
    const [MFADialog,showMFADialog] = useState(false);
    const [token, setToken] = useState('')

    if(isLogin){
        history.push('/');
        /*if(Role == 'Admin'){
            history.push('/admin/dashboard');
        }else{
            history.push('/mySubscription');
        }*/
    }

    
    
    
    const handleTokenSubmit = async()=>{
        setProcessing(true);
        let res:any = await auth.MFALogin({email:Email,pwd:Password, token:token});
        if(res && res.success){
            
            dispatch(login(res.data));
           
        }else{
            setMessage('Invalid Credentials/Token');
        }
        setProcessing(false);
    }
    const handleSubmit = async()=>{
        setProcessing(true);
        let res:any = await auth.login({email:Email,pwd:Password});
        if(res && res.success){
            if (res.data.MFAEnabled){
                showMFADialog(true)
            }
            else{dispatch(login(res.data));}
           
        }else{
            setMessage(res.message);
        }
        setProcessing(false);
    }
    const handleSAML = ()=>{
        window.location.href = "http://localhost:3000/login"
    }

    useEffect(()=>{
        if(qParams.p){
            dispatch(appTheme(qParams.p));
        }
    },[])

    return (
        <div className="login">
            {!MFADialog ? 

            <Paper className="paper">
            <div className="logo-mini"></div>
                <AlertMessage type={ALERT_TYPE.ERROR} message={Message}/>

                <ValidatorForm
                    
                    onSubmit={handleSubmit}
                    onError={errors => console.log(errors)}
                >
                    <Grid container spacing={2}>
                        <Grid item md={12}>
                            <TextValidator
                                variant="outlined"
                                size="small"
                                margin="dense"
                                fullWidth
                                label="Email Address"
                                name="Email"
                                autoFocus
                                onChange={(e:any)=>{ setEmail(e.target.value) }}
                                validators={['required','isEmail']}
                                errorMessages={['Ehis is required','Email is not valie']}
                                value={Email}
                                disabled={processing}
                            />
                        </Grid>
                        <Grid item md={12}>
                            <TextValidator
                                variant="outlined"
                                size="small"
                                margin="dense"
                                fullWidth
                                type="password"
                                label="Password"
                                name="Password"
                                onChange={(e:any)=>{ setPassword(e.target.value) }}
                                validators={['required']}
                                errorMessages={['Password is required']}
                                value={Password}
                                disabled={processing}
                            />
                        </Grid>
                    </Grid>
                    <br/>
                    <Button disabled={processing}
                        type="submit"
                        fullWidth
                        variant="contained"
                        color="primary"
                        onClick={handleSubmit}
                    >
                        Sign In
                    </Button>
                    <LinearProgress style={{display: processing?'':'none' }} />
                    <br/><br/>
                </ValidatorForm>
            
            </Paper>
            : 
            <Paper className="paper">
                <div className="logo-mini"></div>
                <AlertMessage type={ALERT_TYPE.ERROR} message={Message} />
                <>
                <h3 style={{marginTop:0}}>Enter MFA Code</h3>
                <Grid container spacing={1}  mb={3}>
                    <TextField variant="outlined" size="small" fullWidth label="Code"
                        value={token}
                        onChange={(e: any) => { setToken(e.target.value); } } />
                </Grid>
                <Grid container direction="row" justifyContent="flex-end" mt={3}>
                        <Button
                            // sx={{ alignSelf: 'flex-end' }}
                            onClick={handleTokenSubmit}
                            variant="contained"
                            color="primary">Submit</Button>
                             <LinearProgress style={{display: processing?'':'none' }} />
                    </Grid></>
            </Paper>
            }
        </div>
    )

}

export default Login;
